  School for Boys, East Brisbane. She is now retired, except for a few private students. Her chief
  interests are music, genealogy, and gardening.
  Stephen was educated at Queen Elizabeth Grammar School, Ashbourne, Derbyshire, UK and in 1945 he
  followed his parents to New Zealand. He worked with the Civil Aviation Administration before moving to
  Australia, where he sang with the Queensland Light Opera Company. Stephen took his family on annual
  camping safaris from the eastern seaboard to the deserts of Central Australia and later, with his son,
  pioneered the use of ultralight aircraft, mustering in outback Queensland. He was a broadcaster with
  Radio 4MBS (a classical music station in Brisbane) for three years, until his retirement. He now reads
  and sings in the local Anglican Church, and takes a keen interest in all matters to do with aircraft,
  and is presently a member of the Queensland Ultralight Association.
  01> ROBINSON, Jessica Ruth Caccia m on 06.07.1984 to PANTER, David Anthony
  b 16.05.1958
  b 18.09.1958
  Jessica b. at Wellington, NZ, and m, at St John's Cathedral, Brisbane, Qld. David, slo Ernest
  Panter and Eileen Depledge Crossland, b. at Christchurch, NZ. Address: Terriki, 211 Swensons Road,
  Mt Crosby 4306, Qld, Australia.
  Jessica was educated in Brisbane, Queensland, and has followed a career in social welfare, with
  particular emphasis on working with people with disabilities. A competent Toastmaster, she is
  presently studying towards a Bachelor of Business Management degree. She is also manager of a
  support service for the Endeavour Foundation.
  David has a degree in electronic engineering and is an Advanced Toastmaster. Previously an officer
  in the Royal Australian Air Force, he has spent several years working in the computer industry in a
  management capacity. He currently runs his own business, providing a technical writing and
  management consultancy. At present he is studying towards an MBA in Technology Management.
