  02> ROBINSON, Deirdre Julia Kate
  b 29.07.1960
  Deirdre b, at Wellington, NZ. Address: Brisbane, Qld, Australia.
  Deirdre was educated in Brisbane, Queensland, and has travelled extensively in Europe, Africa and
  the Americas. She spent three years with the Australian Army Reserves, achieving the rank of
  Corporal with the Military Police. She has an Associate Diploma of Media Production, and is
  currently studying for a Bachelor of (Primary) Education degree at the Queensland University of
  Technology.
  03> ROBINSON, Toby Joseph Elsworth
  b 16.05.1964
  Toby b. at Brisbane, Australia. Address: 44 Chapman Street, Chapel Hill 4069, Brisbane, Qld,
  Australia.
  Toby was educated at Brisbane and went on to gain his diploma of Audio Engineering. With his
  father, he pioneered the use of ultralight aircraft mustering in outback Queensland. He later
  gained his commercial pilot's licence and has since flown throughout Queensland, the Northern
  Territory and Papua New Guinea. He has worked as a commercial pilot on a 640,000 acre cattle
  station in the Northern Territory and he currently works as a contract pilot in Western Australia,
  mustering sheep and cattle.
